import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ paddingBottom: 2 }}>
      <Toolbar
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        {/* Logo Placeholder */}
        <Box
          component={Link}
          to="/new"
          sx={{
            display: "flex",
            alignItems: "center",
            textDecoration: "none",
            color: "inherit",
            marginBottom: 2,
          }}
        >
          <Box
            sx={{
              width: 50,
              height: 50,
              backgroundColor: "#ccc",
              borderRadius: "50%",
              marginRight: 1,
            }}
          />
          <Typography variant="h5" sx={{ fontWeight: "bold" }}>
            Logo Placeholder
          </Typography>
        </Box>

        {/* Navigation Links */}
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            gap: 4,
            width: "100%",
          }}
        >
          <Button component={Link} to="/venues" color="inherit" sx={{ fontSize: "16px" }}>
            Venues
          </Button>
          <Button component={Link} to="/hair" color="inherit" sx={{ fontSize: "16px" }}>
            Hair
          </Button>
          <Button component={Link} to="/makeup" color="inherit" sx={{ fontSize: "16px" }}>
            Makeup
          </Button>
          <Button component={Link} to="/photographers" color="inherit" sx={{ fontSize: "16px" }}>
            Photographers
          </Button>
          <Button component={Link} to="/music" color="inherit" sx={{ fontSize: "16px" }}>
            Music
          </Button>
        </Box>

        {/* Shopping Cart Icon */}
        <IconButton
          component={Link}
          to="/cart"
          color="inherit"
          sx={{
            position: "absolute",
            top: 16,
            right: 16,
          }}
        >
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
